CREATE TABLE `FC_INNERC_ACCOUNT` (
  `ACCOUNT_ALIAS` char(38) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '账户编号(内部用于方便记忆的编号，比如ICBC5, 与平台编号共同确保唯一号，要有规则)',
  `ACCOUNT_NO` varchar(20) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '账户号',
  `ACCOUNT_NAME` varchar(20) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '账户名称',
  `ACCOUNT_BANK_NAME` varchar(200) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '开户行名(内部转账如果不走加急转账，可以走普通转账，节省费用)',
  `ACCOUNT_BANK_ALIAS` varchar(10) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '银行别名(有字典表)',
  `ACCOUNT_GROUP_ID` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '账户组ID',
  `ACCOUNT_AUTO_TYPE` int(11) NOT NULL COMMENT '账户处理方式(1.自动，0手动，用于出款卡的控制)',
