  `ACCOUNT_TIER` int(11) NOT NULL COMMENT '账户层级(0,充提账户，1中转账户，2资金池账户（资金池账户内部由其它表来具体描述）)',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '账户变更状态时间',
  `CREATE_TIME` datetime NOT NULL COMMENT '账户注册时间',
  `CREATED_BY` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '注册人',
  `MODIFIED_BY` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '修改人',
