CREATE TABLE `FC_SYS_USER` (
  `USER_ID` char(38) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '用户ID',
  `BRANCH_ID` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '机构ID(按层级编码，三位一级，100开头，顺序递增，有系统自动控制)',
  `LOGIN_NAME` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '登录名',
  `USER_NAME` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '用户名称',
  `MOBILE` varchar(20) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '用户手机',
