  `STATUS` int(11) NOT NULL COMMENT '用户状态',
  `PASSWORD` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '用户系统密码(md5加密处理)',
  `UPDATE_TIME` datetime NOT NULL COMMENT '变更时间',
  `CREATE_TIME` datetime NOT NULL COMMENT '注册时间',
  `CREATED_BY` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '注册人(取登录名称（用户的唯一名称）)',
  `MODIFIED_BY` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '修改人',
  `EMAIL` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT 'EMAIL',
  `DATA_ENVIRON` int(11) NOT NULL COMMENT '数据范围权限(现在只有平台权限)',
  `ICON` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '用户头像图标',
  `WORK_CENTER` char(38) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`USER_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户表(用户表)';
